import {  Route, Switch } from "react-router-dom";

// Importing Components
// 
import Home from "./components/Home";
// 

function App() {
	return (
    <React.Fragment>
    <Switch>
    <Route path="/" exact component={Home}/>
    <Route  path="/home" exact component={Home}/>
    <Suspense fallback={<h4>Loading...</h4>}>

    </Suspense>

    </Switch>
</React.Fragment>
	);
}

export default App;
